import React, { useEffect } from 'react';

async function index() {
    return fetch('/', {
        method: 'GET'})
        .then(response => response.json());
}

export default function Projects(){

    useEffect(() => {
        const data = index();
        console.log(data);
    });

    return (
        <div>
            <br/>
            <h1>Projects</h1>
        </div>
    )
}
